"use strict";(self.webpackChunk_juki_team_base_ui=self.webpackChunk_juki_team_base_ui||[]).push([[88966],{"./src/components/organisms/mdMath/constants.ts":(__unused_webpack_module,__webpack_exports__,__webpack_require__)=>{__webpack_require__.d(__webpack_exports__,{$:()=>SAMPLE_MD_CONTENT});const SAMPLE_MD_CONTENT='\n# Juki Markdown Tutorial\n\nEn el ecosistema de Juki utilizamos **Markdown** para redactar textos. Este tutorial cubre todas las características de Markdown soportadas.\n\n> Markdown es un lenguaje de marcado ligero que permite **dar formato a texto** de forma sencilla y legible, usando una sintaxis simple.\n\n## 1. Encabezados\n\nUsa `#` para crear encabezados. Cuantos más `#`, menor el nivel.\n\n```MARKDOWN preview\n# Encabezado nivel 1\n## Encabezado nivel 2\n### Encabezado nivel 3\n#### Encabezado nivel 4\n##### Encabezado nivel 5\n###### Encabezado nivel 6\n```\n\n**Resultado:**\n\n# Encabezado nivel 1\n\n## Encabezado nivel 2\n\n### Encabezado nivel 3\n\n#### Encabezado nivel 4\n\n##### Encabezado nivel 5\n\n###### Encabezado nivel 6\n\n***\n\n## 2. Énfasis\n\n```MARKDOWN\n**negrita**\n*cursiva*\n***negrita cursiva***\n~~tachado~~\n`codigo en linea`\n[Texto del enlace](https://judge.juki.app)\n$1 \\leq N \\leq 10^5, \\sum_{j=0}^3 j^2, \\int_{x=0}^3 x^2$\n```\n\n**Resultado:**\n\n**negrita**\n\n*cursiva*\n\n***negrita cursiva***\n\n~~tachado~~\n\n`codigo en linea`\n\n[Texto del enlace](https://judge.juki.app)\n\n$1 \\leq N \\leq 10^5, \\sum_{j=0}^3 j^2, \\int_{x=0}^3 x^2$\n\n> Si el enlace comienza con `#`, crea un *anchor* (ancla) dentro de la página.  \n>\n> Este identificador debe ser único para que funcione correctamente.\n>\n> ```MARKDOWN\n> [Enlace con anchor](#title-id)\n> ```\n>\n> [Enlace con anchor](#title-id)\n\n***\n\n## 3. Listas\n\n### 3.1 Listas no ordenadas\n\n```MARKDOWN\n- Elemento A\n- Elemento B\n  - Sub-elemento B1\n  - Sub-elemento B2\n```\n\n**Resultado:**\n\n* Elemento A\n\n* Elemento B\n\n  * Sub-elemento B1\n\n  * Sub-elemento B2\n\n### 3.2 Listas ordenadas\n\n```MARKDOWN\n1. Elemento 1\n2. Elemento 2\n   1. Sub-elemento 2.1\n   2. Sub-elemento 2.2\n```\n\n**Resultado:**\n\n1. Elemento 1\n2. Elemento 2\n\n   1. Sub-elemento 2.1\n   2. Sub-elemento 2.2\n\n### 3.3 Listas de tareas (checkboxes)\n\n```MARKDOWN\n- [x] Tarea completada\n- [ ] Tarea pendiente\n```\n\n**Resultado:**\n\n* [x] Tarea completada\n\n* [ ] Tarea pendiente\n\n***\n\n## 5. Imágenes\n\n```MARKDOWN\n![Texto alternativo](https://images.juki.pub/o/juki-judge-blue-bg.png)\n```\n\n![0.74](https://images.juki.pub/o/juki-judge-blue-bg.png)\n\n***\n\n## 6. Citas\n\n```MARKDOWN\n> Esto es una cita.\n>\n> Se puede tener varias líneas en la misma cita.\n```\n\n**Resultado:**\n\n> Esto es una cita.\n>\n> Se puede tener varias líneas en la misma cita.\n\n***\n\n## 7. Bloques de código\n\n````MARKDOWN\n```JAVASCRIPT\nfunction saludo() {\n  console.log("Hola mundo");\n}\n```\n````\n\n**Resultado:**\n\n```JAVASCRIPT\nfunction saludo() {\n  console.log("Hola mundo");\n}\n```\n\n***\n\n## 8. Tablas\n\n```MARKDOWN\n| Columna 1 | Columna 2 | Columna 3 |\n|-----------|-----------|-----------|\n| Fila 1    | Dato 1    | Dato 2    |\n| Fila 2    | Dato 3    | Dato 4    |\n```\n\n**Resultado:**\n\n| Columna 1 | Columna 2 | Columna 3 |\n| :-------- | :-------- | :-------- |\n| Fila 1    | Dato 1    | Dato 2    |\n| Fila 2    | Dato 3    | Dato 4    |\n\n***\n\n## 9. Saltos de línea\n\n* Un salto de línea normal → dejar **una línea vacía**.\n\n* Un salto forzado → agregar **dos espacios** al final de la línea.\n\n***\n\n## 10. Líneas horizontales\n\n```MARKDOWN\n---\n```\n\n**Resultado:**\n\n***\n\n## 11. Matemáticas\n\n```MARKDOWN\n$$\n1 \\leq N \\leq 10^5\n\\\\\n\\sum_{j=0}^3 j^2\n\\\\\n\\int_{x=0}^3 x^2\n\\\\\n\\Big[\\sum_{k=0}^n e^{k^2}\\Big]\n\\\\\n\\left\\langle i,2^{2-i}\\right\\rangle\n\\\\\n\\left.\\frac{df}{dx}\\right|_{x_0}\n\\\\\n\\begin{array}{rcl}\n  0 & \\leftrightarrow &0 \\\\\n  1 & \\leftrightarrow &1 \\\\\n  2 & \\leftrightarrow &4 \\\\\n  \\vdots              &\\vdots\n\\end{array}\n\\\\\nf_n=\n\\begin{cases}\n  a  &\\text{if $n=0$} \\\\\n  r\\cdot f_{n-1} &\\text{else}\n\\end{cases}\n\\\\\n\\begin{pmatrix}\n  a  &b \\\\\n  c  &d\n\\end{pmatrix}\n\\\\\n\\begin{equation*}\n  S=k\\cdot\\lg W\n\\end{equation*}\n\\\\\nf\\colon\\mathbb{R}\\to\\mathbb{R}\n\\\\\n9.8~\\text{m}/\\text{s}^24\n\\\\\n\\lim_{h\\to 0}\\frac{f(x+h)-f(x)}{h}\n\\\\\n\\int x^2\\,dx=x^3/3+C\n\\\\\n\\nabla=\\boldsymbol{i}\\frac{d}{dx}+\\boldsymbol{j}\\frac{d}{dy}+\\boldsymbol{k}\\frac{d}{dz}\n\\\\\n\\sigma^2=\\sqrt{\\,\\sum(x_i-\\mu)^2/N}\n\\\\\nE(X)=\\mu_X=\\sum (x_i-P(x_i))\n\\\\\n\\frac{1}{\\sqrt{2\\sigma^2\\pi}}\\,e^{-\\frac{(x-\\mu)^2}{2\\sigma^2}}\n$$\n```\n\n**Resultado:**\n\n$$\n1 \\leq N \\leq 10^5\n\\\\\n\\sum_{j=0}^3 j^2\n\\\\\n\\int_{x=0}^3 x^2\n\\\\\n\\Big[\\sum_{k=0}^n e^{k^2}\\Big]\n\\\\\n\\left\\langle i,2^{2-i}\\right\\rangle\n\\\\\n\\left.\\frac{df}{dx}\\right|_{x_0}\n\\\\\n\\begin{array}{rcl}\n  0 & \\leftrightarrow &0 \\\\\n  1 & \\leftrightarrow &1 \\\\\n  2 & \\leftrightarrow &4 \\\\\n  \\vdots              &\\vdots\n\\end{array}\n\\\\\nf_n=\n\\begin{cases}\n  a  &\\text{if $n=0$} \\\\\n  r\\cdot f_{n-1} &\\text{else}\n\\end{cases}\n\\\\\n\\begin{pmatrix}\n  a  &b \\\\\n  c  &d\n\\end{pmatrix}\n\\\\\n\\begin{equation*}\n  S=k\\cdot\\lg W\n\\end{equation*}\n\\\\\nf\\colon\\mathbb{R}\\to\\mathbb{R}\n\\\\\n9.8~\\text{m}/\\text{s}^24\n\\\\\n\\lim_{h\\to 0}\\frac{f(x+h)-f(x)}{h}\n\\\\\n\\int x^2\\,dx=x^3/3+C\n\\\\\n\\nabla=\\boldsymbol{i}\\frac{d}{dx}+\\boldsymbol{j}\\frac{d}{dy}+\\boldsymbol{k}\\frac{d}{dz}\n\\\\\n\\sigma^2=\\sqrt{\\,\\sum(x_i-\\mu)^2/N}\n\\\\\nE(X)=\\mu_X=\\sum (x_i-P(x_i))\n\\\\\n\\frac{1}{\\sqrt{2\\sigma^2\\pi}}\\,e^{-\\frac{(x-\\mu)^2}{2\\sigma^2}}\n$$\n\n<br />\n\n## 12. Diagramas\n\n### 12.1 Mermaid\n\nMermaid es un lenguaje de diagramación que permite crear gráficos y diagramas de manera sencilla y flexible.\n\n````MARKDOWN\n```MERMAID\ngraph TD;\n  A--\x3eB;\n  A--\x3eC;\n  B--\x3eD;\n  C--\x3eD;\n```\n````\n\n**Resultado:**\n\n```MERMAID\ngraph TD;\n  A--\x3eB;\n  A--\x3eC;\n  B--\x3eD;\n  C--\x3eD;\n```\n\n### 12.2 Dot con Graphiz\n\nDOT Graphviz es un lenguaje de descripción de gráficos utilizado para crear diagramas y gráficos de forma automatizada. Es un lenguaje de scripting que permite definir la estructura y el diseño de los gráficos mediante un código sencillo y fácil de leer.\n\n````MARKDOWN\n```DOT\ndigraph G {\n  A -> B;\n  A -> C;\n  B -> D;\n  C -> D;\n}\n```\n````\n\n**Resultado**\n\n```DOT asImage\ndigraph G {\n  rankdir=LR;\n  nodesep=0.6;\n  node [shape=circle, style=filled, fillcolor="white", color="#9ca3af", fontname="Inter"];\n  edge [color="#d1d5db", penwidth=1.2];\n\n  // Paso 1: nodo A seleccionado\n  A [fillcolor="#fecaca", color="#ef4444", penwidth=2.5];\n  B; C; D;\n\n  A -> B;\n  A -> C;\n  B -> C;\n  B -> D;\n  C -> D;\n}\n---\ndigraph G {\n  rankdir=LR;\n  nodesep=0.6;\n  node [shape=circle, style=filled, fillcolor="white", color="#9ca3af", fontname="Inter"];\n  edge [color="#d1d5db", penwidth=1.2];\n\n  // Paso 2: se marca el arco A->B (A sigue resaltado)\n  A [fillcolor="#fecaca", color="#ef4444", penwidth=2.5];\n  B; C; D;\n\n  A -> B [color="#ef4444", penwidth=3];\n  A -> C;\n  B -> C;\n  B -> D;\n  C -> D;\n}\n---\ndigraph G {\n  rankdir=LR;\n  nodesep=0.6;\n  node [shape=circle, style=filled, fillcolor="white", color="#9ca3af", fontname="Inter"];\n  edge [color="#d1d5db", penwidth=1.2];\n\n  // Paso 3: ahora se marca el nodo B (A y A->B permanecen)\n  A [fillcolor="#fecaca", color="#ef4444", penwidth=2.5];\n  B [fillcolor="#fecaca", color="#ef4444", penwidth=2.5];\n  C; D;\n\n  A -> B [color="#ef4444", penwidth=3];\n  A -> C;\n  B -> C;\n  B -> D;\n  C -> D;\n}\n---\ndigraph G {\n  rankdir=LR;\n  nodesep=0.6;\n  node [shape=circle, style=filled, fillcolor="white", color="#9ca3af", fontname="Inter"];\n  edge [color="#d1d5db", penwidth=1.2];\n\n  // Paso 4: se marca la arista B->C (ruta A->B->C)\n  A [fillcolor="#fecaca", color="#ef4444", penwidth=2.5];\n  B [fillcolor="#fecaca", color="#ef4444", penwidth=2.5];\n  C; D;\n\n  A -> B [color="#ef4444", penwidth=3];\n  B -> C [color="#ef4444", penwidth=3];\n\n  A -> C;\n  B -> D;\n  C -> D;\n}\n---\ndigraph G {\n  rankdir=LR;\n  nodesep=0.6;\n  node [shape=circle, style=filled, fillcolor="white", color="#9ca3af", fontname="Inter"];\n  edge [color="#d1d5db", penwidth=1.2];\n\n  // Paso 5: nodo C seleccionado\n  A [fillcolor="#fecaca", color="#ef4444", penwidth=2.5];\n  B [fillcolor="#fecaca", color="#ef4444", penwidth=2.5];\n  C [fillcolor="#fecaca", color="#ef4444", penwidth=2.5];\n  D;\n\n  A -> B [color="#ef4444", penwidth=3];\n  B -> C [color="#ef4444", penwidth=3];\n\n  A -> C;\n  B -> D;\n  C -> D;\n}\n```\n\n## 13. Archivos\n\n### 13.1 Documentos PDF\n\n```MARKDOWN\n[\\preview=html\\height=500](https://files.juki.pub/problems/ES/P-1000/3-1720756492462.pdf)\n```\n\n**Resultado:**\n\n[\\preview=html\\height=500](https://files.juki.pub/problems/ES/P-1000/3-1720756492462.pdf)\n\n### 13.2 Paginas HTML\n\n```MARKDOWN\n[\\preview=html\\height=500](https://judge.juki.app/problems)\n```\n\n**Resultado:**\n\n[\\preview=html\\height=500](https://judge.juki.app/problems)\n'}}]);